export function VoterReducer(state, action) {
    const initialState = Object.assign({}, state);
    const updatedState = Object.assign({}, state);

    switch (action.type) {
        case 'isLoadingElections':
            updatedState.isLoadingElections = action.data;
            return updatedState;
        default:
            return initialState;
    }
}
